{"query":"
    query PrerevealAsset($contractAddress: String!) {
  asset(where: {tokenId: {_eq: -1}, contractAddress: {_eq: $contractAddress}}) {
    sourceUri
    publicUrl
    mimeType
  }
}
    ","variables":{"contractAddress":"0x483895723783C2dD65c77d3bFaC099fAd4c783c2"}}

{"query":"
    query CollectionSaleByContractAddress($contractAddress: String!) {
  collectionSales: collection_sale(
    where: {contractAddress: {_eq: $contractAddress}}
  ) {
    id
    collection {
      contractAddress
    }
    limitPerWallet
    mintPrice
    saleType
    createdAt
    updatedAt
  }
}
    ","variables":{"contractAddress":"0x483895723783C2dD65c77d3bFaC099fAd4c783c2"}}

{"query":"
    query DropAllowlistSchedule($contractAddress: String!, $publicKey: String!) {
  collectionSale: collection_sale(
    where: {contractAddress: {_eq: $contractAddress}}
  ) {
    id
    contractAddress
    saleType
    mintPrice
    limitPerWallet
    earlyAccessStartTime
    generalAvailabilityStartTime
  }
  allowlist: allow_list(where: {contractAddress: {_eq: $contractAddress}}) {
    id
    merkleRoot
    merkleTreeUri
    snapshotBlockNumber
    snapshotBlockTimestamp
    holderContractAddresses
  }
  allowlistUser: allow_list_user(
    where: {contractAddress: {_eq: $contractAddress}, publicKey: {_eq: $publicKey}}
  ) {
    merkleRoot
    contractAddress
    ownedContractAddresses
    publicKey
  }
}
    ","variables":{"contractAddress":"0x483895723783C2dD65c77d3bFaC099fAd4c783c2","publicKey":""}}

{"query":"
    query RecentPackMintsForCollection($collectionAddress: ID!, $limit: Limit) {
  items: recentPackMintsForCollection(
    collectionAddress: $collectionAddress
    limit: $limit
  ) {
    blockTimestamp
    user {
      accountAddress
      emailExists
      name
      username
      profileImageUrl
    }
    contractAddress
    numMinted
    nft {
      assetIpfsPath
      assetScheme
      assetHost
      assetPath
      assetId
      assetVersion
      assetStatus
      mimeType
      name
      tokenId
      id
    }
  }
}
    ","variables":{"collectionAddress":"0x483895723783C2dD65c77d3bFaC099fAd4c783c2","limit":4}}

{"query":"
    query AssetFallbackByArtworkIds($artworkIds: [uuid!]!) {
  asset(where: {artwork: {id: {_in: $artworkIds}}, quality: {_eq: "FALLBACK"}}) {
    ...AssetFragment
    artwork {
      id
    }
  }
}

    fragment AssetFragment on asset {
  id
  publicUrl
  quality
  contractAddress
  tokenId
  mimeType
}
    ","variables":{"artworkIds":["22050011-e16c-4c9f-b4c1-c5ff4a2b2bf8"]}}

